import React from 'react';
import './AddressBlock.css';

const data = {
  blockTitle: 'Adresse',
  name: 'Glowspace',
  address: 'Porcelænshaven 26',
  postalNr: '2000 Fredriksberg',
  cvr: "CVR: 4115 9944"
};

const AddressBlock = props => {
  return (
    <div>
      <h2>{data.blockTitle}</h2>
      <ul className="address-block">
        <li>{data.name}</li>
        <li>{data.address}</li>
        <li>{data.postalNr}</li>
        <li className="cvr">{data.cvr}</li>
      </ul>
    </div>
  );
};

export default AddressBlock;
